import React from 'react';

import './App.css';



function App() {
  return (
    <div className="App">


        <Buttons/>
        <History/>



    </div>
  );
}

const mapStateToProps = (state) => ({
  result: state.result,
  history: state.history,
  formula: state.formula,
  isShowHistory: state.isShowHistory


})
export default connect(
  mapStateToProps
